import { Col, Row } from "antd";
import React from "react";
import { Container } from "react-bootstrap";

function Alert() {
  return (
    <div>
      <Container>
        <Row className="justify-content-md-center">
          <Col xs lg="2">
            <div>
              <div>
                <h1>Auto</h1>
              </div>
              <div>
                  <hr/>
              </div>
              <div>
                  SIGNIFICANT CHANGE
              </div>
            </div>
          </Col>
          <Col xs lg="2"></Col>
        </Row>
      </Container>
    </div>
  );
}

export default Alert;
